INSERT INTO `faqs` (`id`, `title`, `description`, `user_id`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Q1. 지사대표(BP)는 무엇이며, 어떻게 할 수 있나요?', '<p><span style=\"color: black;\">A. 지사대표(BP)는 필요한 아이템을 고객에게 매칭하는 세일즈 매칭 전문가 입니다. 호칭은 지사대표 혹은 BP (Biz Planner)라고도 합니다. 지사대표는 구글플레이 스토어 및 애플 앱스토어에서 “My HUB” 어플을 다운받아서 최초 회원 등록 절차와 본사 최종 승인이 완료되면 지사대표(BP)로서 비즈니스를 시작할 수 있습니다. 좀 더 자세한 내용을 알고 싶으시면 비즈니스허브 홈페이지 (</span><a href=\"https://businesshub.co.kr/\" target=\"_blank\" style=\"color: black;\">https://businesshub.co.kr</a><span style=\"color: black;\">)를 방문해 주세요.</span></p>', 568, 1, '2024-04-08 08:02:58', '2024-04-08 08:02:58'),
(2, 'Q2. 본부대표(MD)는 무엇이며, 어떻게 할 수 있나요?', '<p>A.<span style=\"color: black;\">본부대표(MD, Managing Director)는 지사대표(BP) 모집과 전반적 영업 관리의 책임을 갖고 있습니다. 이미 지사대표(BP)로 일정 기간 성과가 있는 경우 본사 최종 승인 과정을 통해 본부대표(MD)로 활동할 수 있습니다. 또한 지사대표(BP) 경험이 없더라도, 이에 상응하는 경력이 증빙된 경우 바로 본부대표(MD)로 시작할 수도 있습니다. 본부대표(MD)의 경우 이 직책에 맞는 권한과 수수료 혜택이 있습니다.&nbsp;&nbsp;</span></p><p><span style=\"color: black;\">&nbsp;&nbsp;&nbsp;&nbsp;본부대표(MD)는 지사대표(BP)와 동일하게 직접 세일즈도 가능합니다.&nbsp;</span></p>', 568, 1, '2024-04-08 08:03:45', '2024-04-08 08:03:45'),
(3, 'Q3. 지사대표(BP) 등록 시 “사업자 등록 번호”가 필요한가요?', '<p>A.<span style=\"color: black;\">아닙니다. 필요하지 않습니다. 지사대표(BP)는 대한민국 국민으로 19세 이상이면 누구나 조건없이 시작할 수 있습니다. 그러므로 기존 사업자, 직장인, 프리랜서, 가정 주부, 무직자 등 누구나 할 수 있습니다.&nbsp;</span></p>', 568, 1, '2024-04-08 08:04:48', '2024-04-08 08:04:48'),
(4, 'Q4. 지사대표(BP)의 신분은 어떻게 되나요? 프리랜서 인가요?', '<p>A.<span style=\"color: black;\">맞습니다. 소득이 발생한 경우 3.3% 소득세 (주민세 포함) 과세 적용 대상이며, 기존 다른 소득이 있다면 합산 과세 적용이 될 것입니다.</span></p>', 568, 1, '2024-04-08 08:05:19', '2024-04-08 08:05:19'),
(5, 'Q5. 지사대표(BP)에도 직급에도 또다른 단계가 있나요? 다단계 인가요?', '<p><span style=\"color: black;\">A. 아닙니다. 저희는 다단계 회사가 아닙니다. 지사대표(BP)에는 또다른 직급 단계는 존재하지 않습니다.&nbsp;</span></p>', 568, 1, '2024-04-08 08:05:59', '2024-04-08 08:05:59'),
(6, 'Q6. My HUB와 BusinessHub는 무엇이 다른가요?', '<p><span style=\"color: black;\">A. My HUB는 BusinessHub 회사에서 지사대표를 위한 영업자 전용 앱의 이름입니다. BusinessHub는 My HUB 앱에 대한 소유권을 갖고 있습니다.&nbsp;</span></p>', 568, 1, '2024-04-08 08:06:31', '2024-04-08 08:06:31'),
(7, 'Q7. 세일즈 아이템 선정 기준과 활용이 궁금해요', '<p><span style=\"color: black;\">A. 세일즈 아이템 선정에 있어서 몇가지 중요한 기준을 갖고 있습니다. 현재 시장에서의 충분한 소비자 구매력, 기존 경쟁 업체, 제휴사 재정성 안정성, 제휴사 업무 지원 역량, 합리적 수수료 제공 가능성, 시장 선점 효과 등 여러 요소들을 검토하여 선정하고 있습니다. 세일즈 아이템 선정은 지사대표(BP)가 직접 추천할 수 도 있습니다. 우수한 아이템 가치가 있다고 판단되는 경우, 추천한 지사대표(BP)에게 향후 판매 이익 공유 등의 별도의 협의를 통해 결정될 수 도 있습니다. 지사대표님들의 많은 아이템 추천을 적극 권장합니다.&nbsp;&nbsp;&nbsp;</span></p>', 568, 1, '2024-04-08 08:07:06', '2024-04-08 08:07:06'),
(8, 'Q8. 지사대표(BP) 수수료에 대해서 전체적으로 궁금해요', '<p><span style=\"color: black;\">A. 지사 수수료는 크게 1) 커미션 : 직접 영업을 통해 발생한 영업 수수료&nbsp;&nbsp;</span></p><p><span style=\"color: black;\">2) 추천 수수료 : 내가 지사대표로 추천한 사람의 커미션에 대한 일정 비율, 2가지가 있습니다. 추천 수수료는 내가 직접 추천한 하위 1대에 대해서만 해당 됩니다. </span></p><p><span style=\"color: black;\">수수료는 회사의 중요 정보이므로, 사업 설명회 및 회사 내부 공지 사항을 통해 알 수 있습니다. &nbsp;&nbsp;</span></p>', 568, 1, '2024-04-08 08:08:21', '2024-04-08 08:08:21'),
(9, 'Q9. My HUB 어플 연 사용료와 혜택은 무엇인가요?', '<p>A.<span style=\"color: black;\">My HUB는 개인 맞춤형 멀티 세일즈 플랫폼입니다. 개인 홈페이지이며, 여러 엄선된 아이템을 내가 원하는 상품을 우선 배열할 수 있고, 나의 고유 개인 온라인 상점으로 연결시키며, 정확하고 투명한 매출 관리를 전산으로 관리 할 수 있도록 만든 매우 우수하고, 차별화 된 플랫폼이며 한계가 없는 수입을 창출할 수 있습니다. 연간 사용료가 없이 무료로 사용하는 경우 비즈니스가 가능하지만, 연 사용료를 납부하면 기존 모든 영업 수수료의 2배, 유료 회원 모집시 1명당 현금 10만원 지급, P2U 전용 쇼핑몰(복지몰) 멤버십, P2U 코인 지급, 다양한 바우처 제공 등 매우 많은 혜택을 받을 수 있습니다. </span></p>', 568, 1, '2024-04-08 08:09:52', '2024-04-08 08:10:12'),
(10, 'Q10. 본사 홈페이지는 네이버 검색하면 나오는데, 영업자 홈페이지는 어디에 있나요?', '<p>•A. 영업자 홈페이지는 구글과 애플 앱 스토어에서 “My HUB” 앱을 다운로드 받아 설치하세요.&nbsp;본사 홈페이지는 영업자 홈페이지와 다릅니다. 본사 홈페이지는 전체적으로 비즈니스 모델 설명에 집중되어 있고 여기서 누군가 구매하는 영업은 불가합니다. 영업은 오로지 영업자 전용 앱을 통해서만이 가능합니다. 영업자 전용 앱의 이름은 \"My HUB\"입니다. 구글과 애플 앱 스토어에서 다운로드를 받을 수 있습니다. 그리고 이 앱은 개인 고유 주소를 보유한 개인 홈페이지, 개인 앱이라고 생각하시면 됩니다.&nbsp;</p>', 568, 1, '2024-04-08 08:17:33', '2024-04-08 08:17:33');
